import './App.css';
import MainPage from './pages/MainPage';
import { createGlobalStyle } from 'styled-components';
import { Routes, Route } from 'react-router-dom';

const GlobalStyle = createGlobalStyle`
  * {
    box-sizing: border-box;
    margin: 0;
  }

  body {
    font-family: sans-serif;
  }

  .left__body__header__img {
  }

  .left__body__header__line {
    border-top: 1px dotted black;
    margin: 12px 0px;
  }

  .left__body__profile {
    display: flex;
    flex-direction: column;
    justify-content: flex-start;
    width: 100%;
    height: 100%;
    font-size: 9px;
    color: #999999;
  }

  .element {
    margin: 5px 0px;
    font-size: 10px;
    color: #000000;
  }

  .left__body__footer {
    width: 100%;
    color: #000000;
  }

  .wrapper__feel {
    width: 100%;
    display: flex;
    flex-direction: column;
    justify-content: center;
  }

  .left__body__footer__header {
    margin-bottom: 5px;
    font-size: 11px;
  }

  .feeling {
    background-color: #FFFFFF;
    width: 140px;
    height: 18px;
    font-size: 11px;
  }

  .wrapper__right {
    width: 524px;
    height: 472px;
    display: flex;
    flex-direction: column;
    justify-content: flex-end;
    padding-left: 5px;
  }

  .wrapper__right__header {
    width: 510px;
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-items: flex-end;
    padding: 0px 14px;
  }

  .right__header__title,
  .right__header__setting {
    color: #55B2E4;
    font-size: 9px;
  }

  .right__header__title {
    font-size: 16px;
  }

  .wrapper__right__body {
    width: 510px;
    height: 445px;
    border: 1px solid gray;
    border-radius: 15px;
    background-color: white;
    padding: 20px;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
  }

  .right__body__header {
    width: 100%;
    height: 48px;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
  }

  .right__body__title {
    display: flex;
    flex-direction: row;
    align-items: center;
  }

  .contents__title {
    color: #55b2e4;
    font-size: 13px;
    font-weight: 700;
  }

  .contents__subtitle {
    font-size: 8px;
    padding-left: 5px;
  }

  .right__body__contents {
    padding-top: 20px;
    font-size: 11px;
    color: gray;
  }

  .right__body__contents__footer {
    width: 458px;
    height: 225px;
    border-radius: 15px;
  }

  .right__body__footer {
    width: 100%;
    height: 270px;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
  }

  .divideLine {
    width: 100%;
    border-top: 1px solid gray;
  }
`;

function App() {
  return (
    <div>
      <GlobalStyle />
      {/* <Main></Main> */}
      <Routes>
            <Route path="/" element={<MainPage />} />
            {/* <Route path="/about" element={<About />} />
            <Route path="/contact" element={<Contact />} />
            <Route path="/album" element={<Album />} /> */}
        </Routes>
    </div>
  );
}

export default App;
